const toCString = (s)=>{
    return new TextEncoder().encode(s + "\0");
};
const fromCString = (memory, idx)=>{
    const mem = new Uint8ClampedArray(memory.buffer);
    for(let i = 0;; i++){
        if (mem[idx + i] == 0) {
            const s = new TextDecoder().decode(mem.slice(idx, idx + i));
            return s;
        }
    }
};
